import React from "react";
import "./portfolio.css";

const Portfolio = () => {
  return (
    <section id="portfolio" className="portfolio-section">
      <div className="portfolio-container">
        <div className="section-header">
          <h2 className="section-title">My Portfolio</h2>
          <p className="section-subtitle">Check out some of my recent work</p>
        </div>

        <div className="portfolio-content">
          <div className="portfolio-image">
            <img
              src={`${process.env.PUBLIC_URL}/Michel.jpg`}
              alt="Michel Munezero Portfolio"
              className="portfolio-img"
            />
          </div>
          <div className="portfolio-description">
            <h3>About My Work</h3>
            <p>
              Here you can see some of my recent projects and work samples. Each
              project represents my dedication to creating beautiful and
              functional web applications.
            </p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Portfolio;
